// Dashboard.js
import React from "react";
import {
  LineChart, Line, PieChart, Pie, Cell, XAxis, YAxis,
  CartesianGrid, Tooltip, Legend, ResponsiveContainer
} from "recharts";
import { motion } from "framer-motion";
import "./Dashboard.css";

const orderData = [
  { date: "Mon", orders: 30 },
  { date: "Tue", orders: 50 },
  { date: "Wed", orders: 40 },
  { date: "Thu", orders: 65 },
  { date: "Fri", orders: 80 },
  { date: "Sat", orders: 55 },
  { date: "Sun", orders: 70 },
];

const productSales = [
  { name: "Smartphones", value: 400 },
  { name: "Laptops", value: 300 },
  { name: "Earbuds", value: 200 },
  { name: "Smart Watches", value: 150 },
];

const COLORS = ["#14b8a6", "#4f46e5", "#f97316", "#ec4899"];

function Dashboard() {
  return (
    <div className="dashboard">
      <motion.h2
        className="dashboard-title"
        initial={{ opacity: 0, y: -10 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
      >
        ðŸŽ¬ Dashboard Overview
      </motion.h2>

      <div className="cards">
        {["ðŸ†• New Orders", "âœ… Orders Processed", "ðŸ’° Revenue", "ðŸ‘¥ Customers"].map((title, index) => (
          <motion.div
            key={index}
            className="card"
            initial={{ opacity: 0, y: 10 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: index * 0.2 }}
          >
            <h3>{title}</h3>
            <p>{[125, 8120, "â‚¹32,500", 1532][index]}</p>
          </motion.div>
        ))}
      </div>

      <div className="progress-area">
        <h3>ðŸšš Order Status</h3>
        <div className="progress-bar">
          <div className="progress pending">Pending</div>
          <div className="progress processing">Processing</div>
          <div className="progress shipped">Shipped</div>
          <div className="progress delivered">Delivered</div>
        </div>
      </div>

      <div className="charts-grid">
        <div className="chart-card">
          <h3>ðŸ“ˆ Weekly Orders</h3>
          <ResponsiveContainer width="100%" height={250}>
            <LineChart data={orderData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="date" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Line type="monotone" dataKey="orders" stroke="#0ea5e9" strokeWidth={3} />
            </LineChart>
          </ResponsiveContainer>
        </div>

        <div className="chart-card">
          <h3>ðŸ¥‡ Top Products</h3>
          <ResponsiveContainer width="100%" height={250}>
            <PieChart>
              <Pie
                data={productSales}
                dataKey="value"
                nameKey="name"
                cx="50%"
                cy="50%"
                outerRadius={80}
                label
              >
                {productSales.map((entry, index) => (
                  <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
                ))}
              </Pie>
              <Tooltip />
              <Legend />
            </PieChart>
          </ResponsiveContainer>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
